import React from 'react';
import './Introduction.css';

const Introduction = () => {
  return (
    <section className="introduction">
      <h2>Who We Are</h2>
      <p>We provide top-notch services to help your business succeed. Our team is dedicated to delivering quality and excellence in everything we do.</p>
    </section>
  );
}

